      (function() {

        const target = 'raw'

        function shouldLoad() {
          if(['raw', 'review', 'tincan', 'xapi'].includes(target))
            return true

          const allowOutsideDriver = window.allowedOptions()?.outsideDriver || false

          return allowOutsideDriver
            || window.location.protocol === 'file:'
            || (window !== window.parent && typeof window.parent.IsLmsPresent === 'function')
        }

        function loadModule(manifest) {
          const p = []

          if (manifest['.css'] != null) {
            for (var idx = 0; idx < manifest['.css'].length; idx++) {
              p.push(new Promise((resolve, reject) => {
                var link = document.createElement('link')
                link.onload = resolve
                link.onerror = reject
                link.rel = 'stylesheet'
                link.href = 'lib/' + manifest['.css'][idx]
                document.body.appendChild(link)
              }))
            }
          }

          if (manifest['.js'] != null) {
            for (var idx = 0; idx < manifest['.js'].length; idx++) {
              p.push(new Promise((resolve, reject) => {
                var script = document.createElement('script')
                script.onload = resolve
                script.onerror = reject
                script.src = 'lib/' + manifest['.js'][idx]
                document.body.appendChild(script)
              }))
            }
          }

          return Promise.all(p)
        }

        function deserialize(str) {
          const buffer = Uint8Array.from(atob(str), c => c.charCodeAt(0))
          const json = new TextDecoder().decode(buffer)
          const result = JSON.parse(json)
          return result
        }

          appDiv.appendChild(errMsgSpan)

        }

  <body>
    <div id="app"></div>
    <script type="text/javascript">
  (function(root) {
    window.partnerContent = [];

    function isExport() {
      return true;
    }

    function resolvePath(path) {
      return ('assets/').concat(path);
    }

    function resolveFontPath(font) {
      return ('lib/fonts/').concat(font.key.split('/').reverse()[0]);
    }

    root.Runtime = {
      fetch: window.__fetchCourse,
      isExport: isExport,
      resolvePath: resolvePath,
      resolveFontPath: resolveFontPath
    };
  }(window));
</script>

    
    <script>__loadEntry()</script>
